import React from "react";
import styled, { css } from "styled-components";

function SuperHeader() {
  return (
    <SuperHeaderElement>
      <SuperHeaderText style={{ "--fontSize": 14 + "px" }}>
        Free shipping on domestic orders over $75!
      </SuperHeaderText>
    </SuperHeaderElement>
  );
}

const SuperHeaderElement = styled.div`
  display: flex;
  background: hsla(220, 3%, 20%, 1);
  width: 1440px;
  height: 40px;
  padding: 12px 12px 0 32px;
`;

const SuperHeaderText = styled.div`
  color: hsla(0, 0%, 100%, 1);
  font-size: var(--fontSize);
`;

export default SuperHeader;
